  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112638 includes underway
  - surface and biological data collected aboard the LAURENCE M. GOULD and NATHANIEL
  B. PALMER during cruises LMG0203, NBP0104 and NBP0204 in the South Atlantic Ocean
  and South Pacific Ocean from 2001-08-03 to 2002-09-11. These data include CHLOROPHYLL
  A and PHAEOPIGMENTS. The instruments used to collect these data include fluorometer.
  These data were collected by Kendra Daly of University of South Florida as part
  of Southern Ocean GLOBEC. The Biological and Chemical Oceanography Data Management
  Office (BCO-DMO) submitted these data to NODC on 2013-07-31.nnThe following is the
  text of the abstract provided by BCO-DMO:nnUnderway Chloro and Phaeo Pigments,nHull
  Intake SamplingnMethods:nSurface chlorophyll samples were collected from the ship's
  flow-through seawater system, which has seawater intakes between 5 and 7 meter depths
  on both ships. About one liter of seawater was vacuum filtered onto GF/F filters
  and passively extracted in 7 ml of 90% acetone at -20deg C in the dark for at least
  24 hours. Chlorophyll fluorescence was then measured on a Turner Design Digital
  10-AU-05 fluorometer calibrated prior to the cruise.nnCalibration ValuesnSouthern
  Ocean GLOBEC II - Nathaniel B. Palmer 01-04nNotes:nPerformed serial dilution calibration
  at start of cruise using Sigma Chemicals chl_a standard.nThe following are the calibration
  values:nnFdnntaunnHn0.109nHn1.970nnMn0.111nMn1.950nnLn0.109nLn1.928nnSouthern Ocean
  GLOBEC III - Laurence M. Gould 02-03nNotes:nPerformed serial dilution calibration
  at start of cruise using Sigma Chemicals chl_a standard.nThe following are the calibration
  values:nnFdnntaunnHn0.145nHn2.301nnMn0.143nMn2.317nnLn0.145nLn2.501nnStudy area:nMean:
  1.15nSD:0.49nMedian:1.10nRange:0.062-2.40nnSouthern Ocean GLOBEC IV - Nathaniel
  B. Palmer 02-04nTurner Designs 10-AU FluorometernNotes:nPerformed serial dilution
  calibration at start of cruise using Sigma Chemicals chl_a standard.nThe following
  are the calibration values:nnFdnntaunnHn0.089nHn2.276nnMn0.086nMn2.270nnLn0.090nLn2.384nnData
  Contributed by:nKendra DalynCollege of Marine SciencenUniversity of South Floridan140
  Seventh Ave., SouthnSt. Petersburg, FL 33701nnPhone: 727 553 1041nE-mail: kdaly@marine,usf.edu
